om-left rounded Corners*/\r\n.jqx-rc-bl\r\n{\r\n    -moz-border-radius-bottomleft: 3px;\r\n    -webkit-border-bottom-left-radius: 3px;\r\n    border-bottom-left-radius: 3px;\r\n}\r\n/*bottom-right rounded Corners*/\r\n.jqx-rc-br\r\n{\r\n    -moz-border-radius-bottomright: 3px;\r\n    -webkit-border-bottom-right-radius: 3px;\r\n    border-bottom-right-radius: 3px;\r\n}\r\n/*top rounded Corners*/\r\n.jqx-rc-t\r\n{\r\n    -moz-border-radius-topleft: 3px;\r\n    -webkit-border-top-left-radius: 3px;\r\n    border-top-left-radius: 3px;\r\n    -moz-border-radius-topright: 3px;\r\n    -webkit-border-top-right-radius: 3px;\r\n    border-top-right-radius: 3px;\r\n}\r\n/*bottom rounded Corners*/\r\n.jqx-rc-b\r\n{\r\n    -moz-border-radius-bottomleft: 3px;\r\n    -webkit-border-bottom-left-radius: 3px;\r\n    border-bottom-left-radius: 3px;\r\n    -moz-border-radius-bottomright: 3px;\r\n    -webkit-border-bottom-right-radius: 3px;\r\n    border-bottom-right-radius: 3px;\r\n}\r\n/*right rounded Corners*/\r\n.jqx-rc-r\r\n{\r\n    -moz-border-radius-topright: 3px;\r\n    -webkit-border-top-right-radius: 3px;\r\n    border-top-right-radius: 3px;\r\n    -moz-border-radius-bottomright: 3px;\r\n    -webkit-border-bottom-right-radius: 3px;\r\n    border-bottom-right-radius: 3px;\r\n}\r\n/*left rounded Corners*/\r\n.jqx-rc-l\r\n{\r\n    -moz-border-radius-topleft: 3px;\r\n    -webkit-border-top-left-radius: 3px;\r\n    border-top-left-radius: 3px;\r\n    -moz-border-radius-bottomleft: 3px;\r\n    -webkit-border-bottom-left-radius: 3px;\r\n    border-bottom-left-radius: 3px;\r\n}\r\n/*all rounded Corners*/\r\n.jqx-rc-all\r\n{\r\n    -moz-border-radius: 3px;\r\n    -webkit-border-radius: 3px;\r\n    border-radius: 3px;\r\n}\r\n/*reset rounded corners*/\r\n.jqx-rc-reset\r\n{\r\n    -moz-border-radius: 0px;\r\n    -webkit-border-radius: 0px;\r\n    border-radius: 0px;\r\n}\r\n\r\n/*Reset Style*/\r\n.jqx-reset\r\n{\r\n    padding: 0;\r\n    margin: 0;\r\n    border: none;\r\n    background: transparent;\r\n}\r\n\r\n/*Disable browser selection*/\r\n.jqx-disableselect\r\n{\r\n    -webkit-user-select: none;\r\n    -khtml-user-select: none;\r\n    -moz-user-select: none;\r\n    -o-user-select: none;\r\n    user-select: none;\r\n    -ms-user-select:none;\r\n    -webkit-touch-callout:none;\r\n}\r\n/*jqxButton, jqxToggleButton, jqxRepeatButton Style*/\r\n.jqx-button{outline: none; border: 1px solid transparent; padding: 3px; text-align: center; vertical-align: central; margin: 0 0 0 0; cursor: default; }\r\n.jqx-buttongroup{}\r\n/*applied to the link button\'s anchor element.*/\r\n.jqx-link\r\n{\r\n    text-decoration: none;\r\n    color: #111111;\r\n}\r\n\r\n/*shows elements.*/\r\n.jqx-visible\r\n{\r\n    display: block;\r\n}\r\n/*hides elements.*/\r\n.jqx-hidden{display: none;}\r\n\r\n/*jqxGauge Style*/\r\n.jqx-gauge-label, .jqx-gauge-caption\r\n{\r\n    fill: #333333;\r\n    color: #333333;\r\n    font-size: 11px;\r\n    font-family: Verdana;\r\n}\r\n/*jqxChart Style*/\r\n.jqx-chart-axis-text,\r\n.jqx-chart-label-text, \r\n.jqx-chart-tooltip-text, \r\n.jqx-chart-legend-text\r\n{\r\n    fill: #333333;\r\n    color: #333333;\r\n    font-size: 11px;\r\n    font-family: Verdana;\r\n}\r\n.jqx-chart-axis-description\r\n{\r\n    fill: #555555;\r\n    color: #555555;\r\n    font-size: 11px;\r\n    font-family: Verdana;\r\n}\r\n.jqx-chart-title-text\r\n{\r\n    fill: #111111;\r\n    color: #111111;\r\n    font-size: 14px;\r\n    font-weight: bold;\r\n    font-family: Verdana;\r\n}\r\n.jqx-chart-title-description\r\n{\r\n    fill: #111111;\r\n    color: #111111;\r\n    font-size: 12px;\r\n    font-weight: normal;\r\n    font-family: Verdana;\r\n}\r\n/*applied to the Grid\'s element.*/\r\n.jqx-grid\r\n{\r\n    overflow: hidden;\r\n    border-style: solid;\r\n    border-width: 1px;\nfont-weight: :xx-small;\nfont-size: :xx-small;\r\n}\r\n/*applied to the Pager.*/\r\n.jqx-grid-pager\r\n{\r\n    border: none;\r\n    border-top: 1px solid transparent;\r\n}\r\n/*applied to the Grid\'s bottom-right area between the horizontal and vertical scrollbars.*/\r\n.jqx-grid-bottomright\r\n{\r\n   \r\n}\r\n/*applied to the Grid\'s header area.*/\r\n.jqx-grid-header \r\n{\r\n    border-style: solid;\r\n    border-width: 0px 0px 1px 0px;\r\n    overflow: hidden;\r\n    border-color: transparent;\r\n    margin: 0px;\r\n    padding: 0px;\r\n }\r\n /*applied to the columns.*/\r\n.jqx-grid-column-header {\r\n    border-style: solid;\r\n    border-width: 0px 1px 0px 0px;\r\n    border-color: transparent;\r\n    white-space: nowrap;\r\n    border-style: solid;\r\n    font-weight: normal;  \r\n    overflow: hidden;\r\n    text-align: left;\r\n    padding: 0px;\r\n    margin: 0px;\r\n }\r\n.jqx-grid-column-header-rtl {\r\n    border-width: 0px 0px 0px 1px;\r\n}\r\n /*applied to the column\'s button.*/\r\n .jqx-grid-column-menubutton {\r\n    border-style: solid;\r\n    border-width: 0px 0px 0px 1px;\r\n    border-color: transparent;\r\n    background-image: url(\'../resources/menubutton.png\');\r\n    background-repeat: no-repeat;\r\n    background-position: center;\r\n    cursor: pointer;\r\n }\r\n.jqx-grid-column-menubutton-rtl {\r\n    border-width: 0px 1px 0px 0px;\r\n}\r\n /*applied to the column\'s sort button when the sort order is ascending.*/\r\n .jqx-grid-column-sortascbutton {\r\n    border: none;\r\n    background-image: url(\'../resources/sortascbutton.png\');\r\n    background-repeat: no-repeat;\r\n    background-position: center;\r\n    cursor: pointer;\r\n }\r\n /*applied to the column\'s sort button when the sort order is descending.*/\r\n  .jqx-grid-column-sortdescbutton {\r\n    border: none;\r\n    background-image: url(\'../resources/sortdescbutton.png\');\r\n    background-repeat: no-repeat;\r\n    background-position: center;\r\n    cursor: pointer;\r\n }\r\n  /*applied to the column\'s filter button.*/\r\n  .jqx-grid-column-filterbutton\r\n {\r\n    border: none;\r\n    background-image: url(\'../resources/filter_dark.png\');\r\n 