border-radius: 0px;\r\n    padding: 0 0 0 0;\r\n    outline: none;\r\n    border: 0px solid #aaaaaa;\r\n    -moz-background-clip: padding; background-clip: padding-box; -webkit-background-clip: padding-box;\r\n}\r\n.jqx-combobox-input::-ms-clear {\r\n    display: none;\r\n}\r\n/*applied to the ComboBox\'s content when the widget is disabled.*/\r\n.jqx-combobox-content-disabled\r\n{\r\n    color: #AAA;\r\n}\r\n/*applied to the ComboBox\'s arrow button.*/\r\n.jqx-combobox-arrow-normal\r\n{\r\n    -webkit-appearance: none;\r\n    outline: none;\r\n    overflow: hidden;\r\n    margin: 0 0 0 0;\r\n    border: none;\r\n}\r\n/*applied to the ComboBox\'s arrow button when the mouse is over the button.*/\r\n.jqx-combobox-arrow-hover\r\n{\r\n    -webkit-appearance: none;\r\n    outline: none;\r\n    overflow: hidden;\r\n    margin: 0 0 0 0;\r\n}\r\n/*applied to the ComboBox\'s arrow button when the ComboBox\'s popup is opened.*/\r\n.jqx-combobox-arrow-selected\r\n{\r\n    -webkit-appearance: none;\r\n    outline: none;\r\n    overflow: hidden;\r\n    margin: 0 0 0 0;\r\n}\r\n/*applied to the ComboBox in normal state.*/\r\n.jqx-combobox-state-normal\r\n{\r\n    -webkit-appearance: none;\r\n    outline: none;\r\n    border: 1px solid transparent;\r\n    overflow: hidden;\r\n    margin: 0 0 0 0;\r\n}\r\n/*applied to the ComboBox when the mouse is over the widget.*/\r\n.jqx-combobox-state-hover\r\n{\r\n    overflow: hidden;\r\n    border: 1px solid transparent;\r\n    margin: 0 0 0 0;\r\n    cursor: pointer;\r\n}\r\n/*applied to the ComboBox when the popup ListBox is shown.*/\r\n.jqx-combobox-state-selected\r\n{\r\n    overflow: hidden;\r\n    border: 1px solid transparent;\r\n    margin: 0 0 0 0;\r\n    cursor: pointer;\r\n}\r\n/*applied to the ComboBox when the widget is focused.*/\r\n.jqx-combobox-state-focus\r\n{\r\n    border: 1px solid transaprent;\r\n}\r\n/*applied to the ComboBox when the widget is disabled.*/\r\n.jqx-combobox-state-disabled\r\n{\r\n    white-space: nowrap;\r\n    margin: 0px;\r\n    color: #AAA;\r\n}\r\n\r\n/*jqxDropDownList Style*/\r\n/*applied to the dropdownlist\'s content element which displays the selected item\'s text or html.*/\r\n.jqx-dropdownlist-content\r\n{\r\n    padding: 0px;\r\n    overflow: hidden;\r\n    padding-left: 3px;\r\n    padding-top: 0px;\r\n    padding-bottom: 0px;\r\n    margin: 0px;\r\n    text-align: left;\r\n    vertical-align: middle;\r\n    white-space: nowrap;\r\n    -webkit-appearance: none;\r\n    outline: 0 none;\r\n    border: none;\r\n}\r\n.jqx-dropdownlist-content-rtl {\r\n    padding-left: 0px;\r\n    padding-right: 3px;\r\n}\r\n\r\n/*applied to the dropdownlist\'s content element which displays the selected item\'s text or html and the widget is disabled. */\r\n.jqx-dropdownlist-content-disabled\r\n{\r\n}\r\n/*applied to the dropdownlist in default state.*/\r\n.jqx-dropdownlist-state-normal\r\n{\r\n    -webkit-appearance: none;\r\n    outline: none;\r\n    border: 1px solid transparent;\r\n    overflow: hidden;\r\n    margin: 0 0 0 0;\r\n}\r\n/*applied to the dropdownlist in hovered state.*/\r\n.jqx-dropdownlist-state-hover\r\n{\r\n    overflow: hidden;\r\n    border: 1px solid transparent;\r\n    margin: 0 0 0 0;\r\n    cursor: pointer;\r\n}\r\n/*applied to the dropdownlist in selected state.*/\r\n.jqx-dropdownlist-state-selected\r\n{ \r\n    overflow: hidden;\r\n    background-color: transparent;\r\n    border: 1px solid transparent;\r\n    margin: 0 0 0 0;\r\n    cursor: pointer;\r\n}\r\n/*applied to the dropdownlist in focused state.*/\r\n.jqx-dropdownlist-state-focus\r\n{\r\n    border: 1px solid #909090;\r\n}\r\n/*applied to the dropdownlist in disabled state.*/\r\n.jqx-dropdownlist-state-disabled\r\n{\r\n\r\n}\r\n/*jqxScrollBar Style*/\r\n.jqx-scrollbar\r\n{\r\n    background: transparent;\r\n    margin: 0;\r\n    padding: 0;\r\n    border: none;\r\n}\r\n/*applied to the scrollbar in default state.*/\r\n.jqx-scrollbar-state-normal\r\n{\r\n    background: #efefef;\r\n    margin: 0px;\r\n    padding: 0px;\r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the scrollbar buttons in default state.*/\r\n.jqx-scrollbar-button-state-normal\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    border: 1px solid transparent; \r\n}\r\n/*applied to the scrollbar buttons in hovered state.*/\r\n.jqx-scrollbar-button-state-hover\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the scrollbar buttons in pressed state.*/\r\n.jqx-scrollbar-button-state-pressed\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the horizontal scrollbar thumb in default state.*/\r\n.jqx-scrollbar-thumb-state-normal-horizontal\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    background: transparent;\r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the horizontal scrollbar thumb in hovered state.*/\r\n.jqx-scrollbar-thumb-state-hover-horizontal\r\n{\r\n    margin: 0px;\r\n    padding: 0px;   \r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the horizontal scrollbar thumb in default state.*/\r\n.jqx-scrollbar-thumb-state-pressed-horizontal\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the vertical scrollbar thumb in default state.*/\r\n.jqx-scrollbar-thumb-state-normal\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the vertical scrollbar thumb in default state.*/\r\n.jqx-scrollbar-thumb-state-hover\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    background: transparent;\r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the vertical scrollbar thumb in default state.*/\r\n.jqx-scrollbar-thumb-state-pressed\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    background: #d1d1d1;\r\n    border: 1px solid #909090;\r\n}\r\n\r\n/* jqxWindow */\r\n.jqx-window\r\n{\r\n    position: absolute;\r\n    overflow: hidden;\r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the jqxWindow when its disabled*/\r\n.jqx-window-disabled\r\n{\r\n}\r\n/*applied to the windows header*/\r\n.jqx-window-header\r\n{\r\n    outline: none;\r\n    border-width: 0px;\r\n    border-bottom: 1px solid transparent; \r\n    overflow: hidden;\r\n    padding: 5px;\r\n    height: auto;\r\n    white-space: nowrap;\r\n    overflow: hidden;  \r\n}\r\n/*applied to the windows header when the window is disabled*/\r\n.jqx-window-header-disabled\r\n{\r\n\r\n}\r\n/*applied to the windows content*/\r\n.jqx-window-content\r\n{\r\n    outline: none;\r\n    overflow: auto;\r\n    text-align: left;\r\n    background-color: transparent;\r\n    padding: 5px;\r\n    -webkit-background-clip: padding-box; background-clip: padding-box;\r\n}\r\n/*applied to the windows content when the window is disabled*/\r\n.jqx-window-content-disabled\r\n{\r\n    outline: none;\r\n    overflow: auto;\r\n    text-align: left;\r\n    padding: 5px;\r\n}\r\n/*applied to the windows close button*/\r\n.jqx-window-close-button\r\n{\r\n    cursor: pointer;\r\n    background-image: url(images/close.png);\r\n    background-repeat: no-repeat;    \r\n}\r\n/*applied to the window\'s collapse button*/\r\n.jqx-window-collapse-button\r\n{\r\n    background-image: url(images/icon-up.png);\r\n    cursor: pointer;\r\n}\r\n/*applied to the window\'s collapse button when the window is collapsed*/\r\n.jqx-window-collapse-button-collapsed\r\n{\r\n    cursor: pointer;\r\n    background-image: url(images/icon-down.png);\r\n}\r\n/*setting styles of the modal windows background*/\r\n.jqx-window-modal\r\n{\r\n   background-color: Black;\r\n}\r\n.jqx-window-close-button-hover\r\n{\r\n}\r\n.jqx-docking\r\n{\r\n    overflow: hidden;\r\n}\r\n.jqx-docking-panel\r\n{\r\n    margin: 0px;\r\n    padding: 0px;\r\n    min-height: 100px;\r\n}\r\n.jqx-docking-drop-indicator\r\n{\r\n    border-style: dashed;\r\n    border-width: 1px;\r\n    margin: 0px;\r\n}\r\n.jqx-docking-window\r\n{\r\n    margin: 0px;\r\n}\r\n\r\n/* jxSlider */\r\n/* applied to jqxSlider widget */\r\n.jqx-slider\r\n{\r\n    outline: none;\r\n    clear: both;\r\n}\r\n/*applied to the ticks which can be in the top/bottom/both sides of the jqxSlider*/\r\n.jqx-slider-tick\r\n{\r\n    border-left: 1px solid transparent;\r\n    z-index: 9; \r\n}\r\n/*applied to the ticks when the slider is in horizontal mode*/\r\n.jqx-slider-tick-horizontal\r\n{\r\n    width: 1px;\r\n    border-left: none;\r\n    margin-top: 1px;\r\n}\r\n/*applied to the ticks when the slider is in vertical mode*/\r\n.jqx-slider-tick-vertical\r\n{\r\n    height: 1px;\r\n    border-top: none;\r\n}\r\n/*applied to the ticks container*/\r\n.jqx-slider-tickscontainer\r\n{\r\n    z-index: 10;\r\n    position: relative;\r\n    margin-top: 0px;\r\n    margin-bottom: 0px;\r\n    z-index: 9;\r\n}\r\n/*applied to the jqxSlider thumb used for changing/indicating current value*/\r\n.jqx-slider-slider\r\n{\r\n    cursor: pointer;\r\n    width: 16px;\r\n    height: 16px;\r\n    z-index: 15;\r\n    position: absolute;\r\n    left: 0px;\r\n    top: 0px;\r\n}\r\n.jqx-slider-button\r\n{\r\n    -moz-border-radius: 9px;\r\n    -webkit-border-radius: 9px;\r\n    border-radius: 9px;    \r\n}\r\n/*applied to the slider\'s thumb when the slider is in horizontal mode*/\r\n.jqx-slider-slider-horizontal\r\n{   \r\n    background-image: url(images/slider_horizontal_classic.png);\r\n    background-repeat: no-repeat;\r\n    margin-top: -5px;\r\n    -moz-border-radius: 7px;\r\n    -webkit-border-radius: 7px;\r\n    border-radius: 7px;    \r\n    border: 1px solid transparent;\r\n}\r\n/*applied to the slider\'s thumb when the slider is in vertical mode*/\r\n.jqx-slider-slider-vertical\r\n{\r\n    margin-left: -5px;\r\n    background-image: url(images/slider_vertical_classic.png);\r\n    background-repeat: no-repeat;\r\n    -moz-border-radius: 7px;\r\n    -webkit-border-radius: 7px;\r\n    border-radius: 7px;\r\n    border: 1px so